script: |
  super -f text -I q1412.spq | sort > q1412.out

inputs:
  - name: q1412.spq
    data: |
      SELECT col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 85 / - col1 NOT BETWEEN ( - 40 * - 10 + + col0 ) AND ( - col0 + ( - + col0 ) + + ( - col1 ) );
  - name: tab1

outputs:
  - name: q1412.out
    data: |
